// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awLayoutSlotRenderFunction } from 'js/AwLayoutSlotService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwLayoutSlotService', () => import('js/AwLayoutSlotService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "initialize": {
            "actionType": "JSFunctionAsync",
            "method": "initialize",
            "outputData": {
                "allSlotsJson": ""
            },
            "deps": "js/AwLayoutSlotService"
        },
        "render": {
            "method": "awLayoutSlotRenderFunction",
            "deps": "js/AwLayoutSlotService"
        }
    },
    "lifecycleHooks": {
        "onMount": "initialize",
        "render": "render"
    },
    "props": {
        "name": {
            "type": "string"
        },
        "context": {
            "type": "object"
        }
    },
    "_viewModelId": "AwLayoutSlot",
    "_uniqueViewModelId": "AwLayoutSlot",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awLayoutSlotRenderFunction, undefined, ctxImportObj );

export default Component;
